import React from "react";
import nba from "nba";

function TeamSearchBar() {
  return (
    <section className="TeamSearchBar">
      <img
        src={`https://www.nba.com/stats/media/img/teams/logos/bkn_logo.svg`}
      ></img>
      <div>
        {nba.teams.forEach(item => {
          <>
            <div>
              <img
                src={`https://www.nba.com/stats/media/img/teams/logos/${item.abbreviation}_logo.svg`}
              ></img>
            </div>
          </>;
        })}
      </div>
    </section>
  );
}

export default TeamSearchBar;
